import React from 'react';
import THead from './THead';
import TBody from './TBody';
import Tr from './Tr';
const index = ({tbodyData, theadData, theme}) => {
	const tbodyDataRender = tbodyData === null ? [] : tbodyData.map((data) => <Tr data={data} theme={theme} />);
	return <table className="table table-bordered table-hover table-striped text-center">{tbodyDataRender}</table>;
};

export default index;
